import React, { useState, useEffect } from 'react';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Navigate,
} from 'react-router-dom';

// Import components for authentication
import LoginPage from './components/Login';


const App = () => {

  return (
    <Router>
      <Routes>
        <Route path="/login" element={<LoginPage />} />

      </Routes>
    </Router>
  );
};

export default App;
